import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';


class HeaderCard extends Component {
    render() {
        return (
            <Container fluid>
                <Row className="my-3">
                    <div class="row my-3">
                        <Col>
                            <img id="logoEsogu" src="esogu-logo.png" />
                        </Col>
                        <Col>
                            <div class="col my-4">
                                <span class="bold header">Eskişehir Osmangazi Üniversitesi</span>
                                <br />
                                Öğrenci Yönetim Sistemi
                            </div>
                            <div class="col closeApp">
                                <div class="m-0">Merhaba, John Doe</div>
                                <div><button class="btn btn-secondary">Çıkış Yap</button></div>
                            </div>
                        </Col>
                    </div>
                </Row>
            </Container>
        )
    }
}

export default HeaderCard;
